import pandas as pd

# Define the table
data = {
    "home team": ["geelong", "collingwood", "carlton", "richmond", "north melbourne", "st kilda"],
    "home team score": [13.12, 12.16, 10.16, 10.18, 9.14, 13.14],
    "away team": ["hawthorn", "south melbourne", "essendon", "melbourne", "footscray", "fitzroy"],
    "away team score": [7.6, 13.12, 11.14, 15.4, 9.14, 9.15],
    "venue": ["kardinia park", "victoria park", "princes park", "punt road oval", "arden street oval", "junction oval"],
    "crowd": [16870, 18556, 29744, 24000, 22000, 11500],
    "date": ["14 august 1954", "14 august 1954", "14 august 1954", "14 august 1954", "14 august 1954", "14 august 1954"]
}

# Convert the data to a DataFrame
df = pd.DataFrame(data)

# Check if 'kardinia park' is one of the venues where the home team score is higher than the away team score
relevant_cells = []
for i in df.index:
    if df.loc[i, "venue"] == "kardinia park" and (df.loc[i, "home team score"] > df.loc[i, "away team score"]):
        relevant_cells.append({"row_index": i, "column_name": "date"})
    elif df.loc[i, "home team score"] > df.loc[i, "away team score"]:
        relevant_cells.append({"row_index": i, "column_name": "venue"})

# If the condition is met, append row index and column name to list
if len(relevant_cells) == 1:
    answer = "TRUE"
elif len(df[df["home team score"] > df["away team score"]]) >= 2:
    answer = "TRUE"
else:
    answer = "FALSE"

print({
  "answer": answer,
  "relevant_cells": relevant_cells
})
